import styles from './style.module.scss';

const Navbar = () => {
  return (
    <div className={styles.navbar}>
        <div><h2>trxvl</h2></div>
        <div>
            <ul className={styles.navItems}>
                <li><a href=''>Home</a></li>
                <li><a href=''>Stays</a></li>
                <li><a href=''>Flights</a></li>
                <li><a href=''>Packages</a></li>
